import React from "react";

const App = () => {
    return(
        <>
            <div className="container">
                <div className="head">
                    <img src="./images/logo-bonus.svg" alt='logo'></img>
                    <div className="score">
                        <p>SCORE</p>
                        <span>12</span>
                    </div>
                </div>
                <div className="game">
                    
                </div>
            </div>
        </>
    )
}

export default App;
